    false,nt"url": null,nt"notes": "This narrative report for Kenai National
    Wildlife Refuge summarizes refuge activities from January through April of 1951.
     The report begins with general information about weather conditions and fires
    on the refuge.  Wildlife- including migratory birds, upland game birds, big game
    animals, fur animals, and fish- is also covered.  The report includes a refuge development
    section which discusses physical developments and plantings on the refuge.  Economic
    uses of the refuge are outlined; timber removal and fur harvesting were the only
    uses during this period.  The public relations section of the report discusses recreational
    uses of the refuge, refuge visitors, refuge participation, and enforcement.",nt"owner_org":
